import React, { Component } from 'react';
import { withRouter } from 'react-router-dom';

class Header extends Component {

      onNav =(path)=>{
        this.props.history.push(path)
      }

    render() {
        return (
            <div>
                <h1>Welcome to the Shop</h1>
                <nav>
                <button onClick= {()=> this.onNav('/Home')}>Home</button>
                <button onClick={()=> this.onNav('/Product')}>Product</button>
                <button onClick={()=> this.onNav('/Contact')}>Contact</button>
                <button onClick={()=> this.onNav('/Login')}>Login</button>
                </nav>

            </div>
        )
    }
}
export default withRouter(Header);
